const parseValue = (value: string | undefined, type: string) => {
	if (!value || value === "\\N" || value.trim() === "") {
		return null;
	}
	const cleanValue = value.trim();

	switch (type) {
		case "int":
			return parseInt(cleanValue, 10);
		case "float":
			return parseFloat(cleanValue);
		case "bool":
			return cleanValue === "t" || cleanValue === "true" || cleanValue === "1";
		case "date":
			return new Date(cleanValue);
		case "time":
			return new Date(`1970-01-01T${cleanValue}Z`);
		case "string":
		default:
			return cleanValue;
	}
};

async function main() {
	const lines = rawData.trim().split("\n");
	const valuesBatch: any[] = [];

	console.log(`Memproses ${lines.length} baris data...`);

	for (const line of lines) {
		// Split berdasarkan TAB (\t).
		const cols = line.split("\t");

		if (cols.length < 2) continue;

		const rowValues = [
			parseValue(cols[0], "int"), // id
			parseValue(cols[1], "date"), // date
			parseValue(cols[2], "int"), // comprehension_confidence
			parseValue(cols[3], "string"), // course_id
			parseValue(cols[4], "date"), // created_at
			parseValue(cols[5], "int"), // distraction_events
			parseValue(cols[6], "int"), // duration_minutes
			parseValue(cols[7], "string"), // instruction_method
			parseValue(cols[8], "string"), // module_id
			parseValue(cols[9], "string"), // mood_after
			parseValue(cols[10], "string"), // mood_before
			parseValue(cols[11], "int"), // num_attempts_quiz
			parseValue(cols[12], "int"), // num_pauses
			parseValue(cols[13], "bool"), // opened_feedback
			parseValue(cols[14], "int"), // perceived_cognitive_load
			parseValue(cols[15], "int"), // quiz_score
			parseValue(cols[16], "float"), // sleep_hours_prev_night
			parseValue(cols[17], "time"), // start_time
			parseValue(cols[18], "int"), // stress_level
			parseValue(cols[19], "string"), // student_id
			parseValue(cols[20], "int"), // task_difficulty_rating
			parseValue(cols[21], "int"), // time_to_complete_quiz_seconds
			parseValue(cols[22], "float"), // time_to_open_feedback_hours
		];

		valuesBatch.push(Prisma.sql`(${Prisma.join(rowValues)})`);
	}

	if (valuesBatch.length > 0) {
		try {
			const insertedCount = await prisma.$executeRaw`
        INSERT INTO "LearningFatigueMetric" (
          "id", "date", "comprehension_confidence", "course_id", "created_at",
          "distraction_events", "duration_minutes", "instruction_method", "module_id",
          "mood_after", "mood_before", "num_attempts_quiz", "num_pauses",
          "opened_feedback", "perceived_cognitive_load", "quiz_score",
          "sleep_hours_prev_night", "start_time", "stress_level", "student_id",
          "task_difficulty_rating", "time_to_complete_quiz_seconds", "time_to_open_feedback_hours"
        )
		VALUES ${Prisma.join(valuesBatch)}
        ON CONFLICT ("id") DO NOTHING;
      `;

			console.log(`Berhasil insert (atau skip jika duplikat): ${insertedCount} rows.`);

			await prisma.$executeRaw`
        SELECT setval(
            pg_get_serial_sequence('"LearningFatigueMetric"', 'id'),
            COALESCE((SELECT MAX(id) + 1 FROM "LearningFatigueMetric"), 1),
            false
        );
      `;
			console.log("Auto-increment sequence berhasil di-reset.");
		} catch (error) {
			console.error("Gagal melakukan seeding:", error);
		}
	} else {
		console.log("Tidak ada data valid yang ditemukan.");
	}
}

main()
	.catch((e) => {
		console.error(e);
		process.exit(1);
	})
	.finally(async () => {
		await prisma.$disconnect();
	});
